import React from 'react'
import Layout from '../Layout/Layout'
import SignupFeatures from '../Features/SignupFeatures'

const Signup = () => {
  return (
    <>
    <Layout title={'SignUp Here'}>
      <SignupFeatures/>
    </Layout>
    </>
  )
}

export default Signup
